import React, { useState } from 'react';
import { useLocation } from 'react-router-dom';
import axios from 'axios'; 

const CooperationTemplate = () => {
    const location = useLocation();
    const { projectTitle, building } = location.state || {
         projectTitle: "Unknown Project", building: {
             title: "Unknown Cooperation" } };
    
    
    const [formData, setFormData] = useState({
        entrance: '',
        floor: '',
        apartment: '', 
        undergroundFloor: '',
        garage: '', 
        
      });
      const [errors, setErrors] = useState({});
      const [success, setSuccess] = useState(null);
    
      const handleInputChange = (e) => {
        const { name, value } = e.target;
        setFormData({
          ...formData,
          [name]: value,
        });
      };
    
      const handleDateChange = (date, name) => {
        setFormData({
          ...formData,
          [name]: date,
        });
      };
      const createBuilding = async (e) => {
        e.preventDefault();
    
        const newErrors = {};
        if (!formData.title) newErrors.title = 'Title is required';
        if (!formData.eik) newErrors.eik = 'Eik is required';
        if (!formData.address) newErrors.address = 'Address is required'; // ново поле за адрес
        if (!formData.parcelArea) newErrors.parcelArea = 'Parcel area is required';
        if (!formData.startDate) newErrors.startDate = 'Start Date is required';
        if (!formData.endDate) newErrors.endDate = 'End Date is required';
        if (!formData.buildingCount) newErrors.buildingCount = 'Building Count is required';
        if (!formData.buildingStatus) newErrors.buildingStatus = 'Building Status is required';
    
        if (Object.keys(newErrors).length > 0) {
          setErrors(newErrors);
        } else {
          try {
            // Преобразуваме датите във формат LocalDate, защото бекенда очаква `LocalDate`
            const startDateFormatted = formData.startDate.toISOString().split('T')[0];
            const endDateFormatted = formData.endDate.toISOString().split('T')[0];
    
            // Изпращаме POST заявка към бекенда
            const response = await axios.post('http://localhost:8080/cooperation/{id}', {
                title: formData.title,
                eik: formData.eik,
                address: formData.address,
                parcelArea: parseFloat(formData.parcelArea),
                startDate: startDateFormatted,
                endDate: endDateFormatted,
                buildingCount: parseInt(formData.buildingCount),
                buildingStatus: formData.buildingStatus,
              });
              
    
            console.log('Building created successfully:', response.data);
            setSuccess('Project created successfully!');
            setErrors({}); // Изчистваме грешките
    
            // Зануляваме формата при успех
            setFormData({
              title: '',
              eik: '',
              address: '', // изчистваме адреса
              parcelArea: '',
              startDate: new Date(),
              endDate: new Date(),
              buildingCount: '',
              buildingStatus: '',
            });
          } catch (error) {
            console.error('Error creating building:', error);
            setSuccess(null);
          }
        }
      };



    return (
        <div>
            <h1>Cooperation: {building.title} in {projectTitle}</h1>
            <div className="buildings-container">
            <div>Description: {building.description}</div>
            <div>Rsp:{building.rsp}</div>
            <div>Stages: AKT 14, AKT 15{building.rsp}</div>
            </div>

            
      <div className="card">
        <div className="card-body">


          <h1>Quick Create Blank</h1>
          <form onSubmit={createBuilding}>
            {success && <div className="alert alert-success">{success}</div>}
            
            <div className="form-group">
              <label htmlFor="buildingCount">Entrance Count</label>
              <input
                type="number"
                className={`form-control ${errors.buildingCount ? 'is-invalid' : ''}`}
                id="buildingCount"
                name="buildingCount"
                placeholder="Entrance Count"
                value={formData.buildingCount}
                onChange={handleInputChange}
                min="1"
              />
              {errors.buildingCount && <small className="text-danger">{errors.buildingCount}</small>}
            </div>
            
            <div className="form-group">
              <label htmlFor="buildingCount">Floor Count</label>
              <input
                type="number"
                className={`form-control ${errors.buildingCount ? 'is-invalid' : ''}`}
                id="buildingCount"
                name="buildingCount"
                placeholder="Floor Count"
                value={formData.buildingCount}
                onChange={handleInputChange}
                min="1"
              />
              {errors.buildingCount && <small className="text-danger">{errors.buildingCount}</small>}
            </div>

            <div className="form-group">
              <label htmlFor="buildingCount">Apartment Count</label>
              <input
                type="number"
                className={`form-control ${errors.buildingCount ? 'is-invalid' : ''}`}
                id="buildingCount"
                name="buildingCount"
                placeholder="Apartment Count"
                value={formData.buildingCount}
                onChange={handleInputChange}
                min="1"
              />
              {errors.buildingCount && <small className="text-danger">{errors.buildingCount}</small>}
            </div>

            <div className="form-group">
              <label htmlFor="buildingCount">Underground Floor Count</label>
              <input
                type="number"
                className={`form-control ${errors.buildingCount ? 'is-invalid' : ''}`}
                id="buildingCount"
                name="buildingCount"
                placeholder="Underground Floor Count"
                value={formData.buildingCount}
                onChange={handleInputChange}
                min="1"
              />
              {errors.buildingCount && <small className="text-danger">{errors.buildingCount}</small>}
            </div>

            <div className="form-group">
              <label htmlFor="buildingCount">Garage Count</label>
              <input
                type="number"
                className={`form-control ${errors.buildingCount ? 'is-invalid' : ''}`}
                id="buildingCount"
                name="buildingCount"
                placeholder="Garage Count"
                value={formData.buildingCount}
                onChange={handleInputChange}
                min="1"
              />
              {errors.buildingCount && <small className="text-danger">{errors.buildingCount}</small>}
            </div>

            

            <button type="submit" className="btn btn-outline-primary mt-3">
              Create Objects
            </button>
          </form>
        </div>
      
    </div>
        </div>
    );
};

export default CooperationTemplate;
